import React, { useContext, useState } from 'react'
import { Authen, Home } from './screens'
import { updateLoginState } from './store/actions'
import { useStore } from './store'
const App = () => {

 const [state,dispatch] = useStore()
 const {userLoginState} = state

 console.log(state)

 const ChangeAuthMode = () => {
  dispatch(updateLoginState(!userLoginState))
 }

  return (
    <div>
      {userLoginState ? 
      <Home />
      :
      <Authen />  
    }
      <button onClick={ChangeAuthMode} className='btn border-l-indigo-300 w-full p-2'>Change State</button>
    </div>
  )
}

export default App
